@Christian HernándezNo soy doctor, mi prima lo es e incluso ella se dio cuenta de la gran mentira cuando el año pasado los noticiarios decían que los hospitales estaban llenos y ella de primera mano supo que no era así.
Supongo que te pego la enfermedad porque tuvisteis una enfermedad crónica por dentro o padecias alguna anemia u otra enfermedad respiratoria.
La gente sana y no tan saludable como el caso del señor del parque y muchos más no son suerte son la EVIDENCIA DEL GRAN CORONA CUENTO QUE TE HAN METIDO POR LAS NARICES Y TU MUY TRANQUILO.

